// import logo from './logo.svg';
// import './App.css';
import bimage from './b.png'
import Main from './main/main';
import Navbar from './Navbar/navbar'
function App() {
  return (
    <>
    <div style={{backgroundImage:`url(${bimage})`}}>
    <Navbar/>
    <br />
    <Main/>
    </div>
    </>
  );
}

export default App;
